import { reqCartList } from "@/api"

const state = {}
const actions = {
    async getCartList({commit}){
        let result = await reqCartList()
        if(result.code === 200){
            commit("GETCARTLIST",result.data)
        }
    }
}
const mutations = {}
const getters = {}
export default {
    state,
    actions,
    mutations,
    getters
}
